Chandershekhar Pandey and his wife, Lajwanti, come to visit Brij Bhushan and his widowed mother in their village. They assure Brij's mom that in exchange of their land, they will get Brij a small shop in Bombay, and in this way they get the land transferred in their name. Ten years later, Brij's mom passes away and re-locates to Bhuleshwar, Bombay, where Chandershekhar lives with his wife, two unmarried sons, Ram and Shyam, and an unmarried daughter, Bindu. Brij is treated as a mere servant, not paid, but abused and beaten everyday, needless to say Chandershekhar is not going to fulfill his promise of getting him a shop. His only companion on which he shoulder he can cry is the Pandey's maidservant, Parvati alias Paro. Then things turn better for Brij when he finds himself the lucky owner of a Rs.2,50,000 lottery ticket. This suddenly changes everyone's attitude toward him... Written by rAjOo (&lt;a class=&quot;__cf_email__&quot; href=&quot;/cdn-cgi/l/email-protection&quot; data-cfemail=&quot;adcad8c3daccc3d9c4edc5c2d9c0ccc4c183cec2c0&quot;&gt;[email&amp;#160;protected]&lt;/a&gt;&lt;script cf-hash='f9e31' type=&quot;text/javascript&quot;&gt;
